import React from "react";
import PostItem from "./posts";

export default function PostList(props) {
    return(
        <div>
            <h1>{props.title}</h1>
            {props.posts.map((post)=>{
                    <PostItem post={post} key={post.id}/>
                }
            )
            }
        </div>
    )
}
